// SPDX-License-Identifier: MIT

pragma solidity >=0.7.0 <0.9.0;

contract Upload {

    //Struct to check file view history
    struct ViewHistory{
        address viewer;
        uint256 timestamp;
    } 


    //A file struct that contains metadata about the file 
    struct File{
        uint256 id;
        string ipfsHash;
        address[] accessList;
        ViewHistory[] viewHistory;
    }

    //A mapping to store users id
    mapping(address => uint256[]) userIds;

    // a mapping to store the address to id to files
    mapping(address => mapping(uint256 => File)) files;

    //events when state changing functions are called
    event FileAdded(address indexed userAddress, uint256 indexed fileId);
    event GrantedAccess(address indexed GranterAddress, address indexed GranteeAddress, uint256 indexed fileId);
    event RevokedAccess(address indexed GranterAddress, address indexed GranteeAddress, uint256 indexed fileId);
    event FileViewed(address indexed viewerAddress, uint256 indexed timestamp, uint256 fileId);

    //A function to add a file 
    function addFile(address _userAddress, string memory _hash) public{
        //ensure address isnt a 0 address and hash isnt empty
        require(_userAddress != address(0), "Zero Address");
        require(keccak256(abi.encodePacked(_hash)) != keccak256(""), "Empty string");
        //ensure caller is the same person in the address bar
        require(msg.sender == _userAddress, "AddressNotOwner");
        //get currentId Count
        uint256 _currentId  = (userIds[_userAddress].length) + 1;
        //push file to mapping
        files[_userAddress][_currentId].id = _currentId;
        files[_userAddress][_currentId].ipfsHash = _hash;
        userIds[_userAddress].push(_currentId);

        emit FileAdded(_userAddress, _currentId);
    }

    // function to allow a user view file
    function allowUser(uint256 _fileId, address _ownerAddress, address _userAddress) public {
        //allow owner to be caller
        require(msg.sender == _ownerAddress, "Not Owner");
        //ensure its a real file id
        require(files[_ownerAddress][_fileId].id == _fileId, "WrongId");

        //give user access
        files[_ownerAddress][_fileId].accessList.push(_userAddress);

        emit GrantedAccess(_ownerAddress, _userAddress, _fileId);

    }

    //function to disallow user from viewing file 
    function revokeUser(uint256 _fileId, address _ownerAddress, address _userAddress) public {
        //allow owner to be caller
        require(msg.sender == _ownerAddress, "Not Owner");
        //ensure user has permission before
        address[] memory _addrArray  = files[_ownerAddress][_fileId].accessList;
        bool _isAllowed = checkAddressInsideArray(_userAddress, _addrArray);
        require(_isAllowed, "User Not Allowed");
        //revoke  user access
        //find the index of the user in the access list
        uint256 _index = findIndex(_userAddress, _addrArray);
        //remove the user from the access list by swapping with the last element and popping
        files[_ownerAddress][_fileId].accessList[_index] = files[_ownerAddress][_fileId].accessList[_addrArray.length - 1];
        files[_ownerAddress][_fileId].accessList.pop();

        emit RevokedAccess(_ownerAddress, _userAddress, _fileId);

    }

    //neccessary state changing function for logging view history
    function logView(uint256 _fileId, address _ownerAddress) public {
        address[] memory _addrArray  = files[_ownerAddress][_fileId].accessList;
        bool _isAllowed = checkAddressInsideArray(msg.sender, _addrArray);
        require(_isAllowed || msg.sender == _ownerAddress, "Not Allowed");

        ViewHistory memory _newHistory = ViewHistory(msg.sender, block.timestamp);
        files[_ownerAddress][_fileId].viewHistory.push(_newHistory);

        emit FileViewed(msg.sender, block.timestamp, _fileId);
    }

    //Always log view before view file 
    function viewFile(uint256 _fileId, address _ownerAddress) public view returns(string memory){
        address[] memory _addrArray  = files[_ownerAddress][_fileId].accessList;
        bool _isAllowed = checkAddressInsideArray(msg.sender, _addrArray);

        //check if view has been logged before allowing file view

        require(_isAllowed || msg.sender == _ownerAddress, "Not Allowed");

        return files[_ownerAddress][_fileId].ipfsHash;
    }

    function viewFileHistory(uint256 _fileId, address _ownerAddress) public view returns(ViewHistory[] memory){
        //ensure its file owner calling the function
        require(msg.sender  == _ownerAddress, "Not Owner");
        //ensure its a real file id
        // require(files[_ownerAddress][_fileId].id == _fileId, "WrongId");

        return files[_ownerAddress][_fileId].viewHistory;
    }

    function getOwnerFiles(address _ownerAddress) public view returns(uint256[] memory){
           //ensure its file owner calling the function
        require(msg.sender  == _ownerAddress, "Not Owner");

        return userIds[_ownerAddress];
    }

    function checkAddressInsideArray(address _value, address[] memory _myArray) private pure returns (bool) {
        // loop through the array and check for equality
        for (uint i = 0; i < _myArray.length; i++) {
            if (_myArray[i] == _value) {
                return true; // found a match
            }
        }
        return false; // no match
    }

     //helper function to find the index of an address in an array of addresses
    function findIndex(address _addr, address[] memory _array) internal pure returns (uint256) {
        for (uint256 i = 0; i < _array.length; i++) {
            if (_array[i] == _addr) {
                return i;
            }
        }
        revert("Address Not Found");
    }

}

